description:
Festive six-track EP from ex-Test Icicle and creator of Falling Off the Lavender Bridge, Lightspeed Champion.

01) Intro (I Forgot To Wrap Your Present)
02) Happy New Year
03) Another Song About Being Alone
04) I Forgot To Wrap Your Present
05) Outro (I Forgot To Wrap Your Present)
06) Perfect Harmony

